// 
import { Typography } from "@mui/material";
import { 
  FullScreenContainer,
  StyledPaper,
  StyledForm,
  StyledInput,
  StyledText,
  StyledTextField,
  StyledBottomText,
  StyledLink,
  StyledButton,
  SignupDoublegrid,
  Signupleft,
  LeftImage,
  LeftText,
  SignupRight
} from "../common/loginsignupstyles";
import { ReactComponent as Logo } from '../images/Logo_with_text.svg';
import { Navigate, useNavigate } from "react-router-dom";
import { useState } from "react";
import axios from "axios";

export const Signup = () => {
  const [phoneNo, setPhoneno] = useState('');
  const [email, setEmail] = useState('');
  const [isOtpModalOpen, setIsOtpModalOpen] = useState(false);
  const [otp, setOtp] = useState('');
  const nav = useNavigate();

  const handleRegister = async () => {
    const user = {
      emailId: email,
      phoneNumber: phoneNo,
    };

    try {
      const response = await axios.post("http://localhost:8000/api/v1/users/signup", user);
      if (response.status === 201 || response.status === 200) {
        setIsOtpModalOpen(true);
      } else {
        alert("Registration failed: " + (response.data.message || "Unknown error"));
      }
    } catch (error) {
      if (axios.isAxiosError(error)) {
        if (error.response) {
          alert("Error: " + (error.response.data.message || "Unknown error from server"));
        } else if (error.request) {
          alert("Error: No response from server. Please try again later.");
        } else {
          alert("Error: " + error.message);
        }
      }
    }
  };

  const handleOtpVerify = async () => {
    const otpPayload = {
      emailId: email,
      otp,
    };
    try {
      const response = await axios.post("http://localhost:8000/api/v1/users/verify-otp", otpPayload, { withCredentials: true });
      if (response.status === 200) {
        alert("OTP verification successful!");
        setIsOtpModalOpen(false);
        alert("Registration and LogIn Successful!");
        nav("/");
      } else {
        alert("OTP verification failed: " + (response.data.message || "Unknown error"));
      }
    } catch (error) {
      if (axios.isAxiosError(error)) {
        if (error.response) {
          alert("Error: " + (error.response.data.message || "Unknown error from server"));
        } else if (error.request) {
          alert("Error: No response from server. Please try again later.");
        } else {
          alert("Error: " + error.message);
        }
      }
    }
  };

  return (
    <FullScreenContainer>
      <StyledPaper>
        <Typography sx={{ textAlign: "center", fontSize: "1.75rem", fontWeight: "800", fontFamily: "Baikal, Inter, sans-serif", letterSpacing: "-0.025em" }}>
          Get Started
        </Typography>
        <Typography sx={{ textAlign: "center", fontSize: "12px" }}>
          Please enter your details to create your account
        </Typography>
        <StyledForm>
          <StyledInput>
            <StyledText>Phone No.</StyledText>
            <SignupDoublegrid>
              <Signupleft>
                <LeftImage src="https://tyke-assets.s3.amazonaws.com/flags/in-flag.jpg" />
                <LeftText>+91</LeftText>
              </Signupleft>
              <SignupRight>
                <StyledTextField
                  onChange={(e) => { setPhoneno(e.target.value); }}
                  variant='outlined'
                  placeholder='Phone No.'
                />
              </SignupRight>
            </SignupDoublegrid>
          </StyledInput>
          <StyledInput>
            <StyledText>Email</StyledText>
            <StyledTextField
              onChange={(e) => { setEmail(e.target.value); }}
              variant='outlined'
              placeholder='Email'
            />
            <StyledBottomText>
              By clicking Continue, you agree to our
              <StyledLink to="/terms">Terms & Conditions </StyledLink>
              and {' '}
              <StyledLink to="/terms"> Privacy Policy</StyledLink>.
            </StyledBottomText>
            <StyledButton onClick={handleRegister}>Get OTP</StyledButton>
          </StyledInput>
        </StyledForm>
        <StyledBottomText>
          Already have an Account?
          <StyledLink to='/login'>Login </StyledLink>
        </StyledBottomText>
      </StyledPaper>
      {isOtpModalOpen && (
        <div>
          <h2>Enter OTP</h2>
          <input type="text" value={otp} onChange={(e) => setOtp(e.target.value)} />
          <button onClick={handleOtpVerify}>Verify OTP</button>
        </div>
      )}
    </FullScreenContainer>
  );
};
